    "js": "class Details extends HTMLElement {\r\n\r\n   static props = {\r\n      title: { \r\n         type: 'string', \r\n         default: '', \r\n         required: false \r\n      },\r\n      text: { \r\n         type: 'string', \r\n         default: '', \r\n         required: false \r\n      }\r\n   };\r\n\r\n   constructor(props) {\r\n      super();\r\n      slice.attachTemplate(this);\r\n\r\n      this.$detailsTitle = this.querySelector('.details_title');\r\n      this.$detailsText = this.querySelector('.details_text');\r\n      this.$details = this.querySelector('.full_details');\r\n      this.$summary = this.querySelector('.details_summary');\r\n      this.$container = this.querySelector('.details_container');\r\n\r\n      this.$summary.addEventListener('click', () => {\r\n         this.toggleDetails();\r\n      });\r\n\r\n      slice.controller.setComponentProps(this, props);\r\n   }\r\n\r\n   init() {\r\n      // Component initialization\r\n   }\r\n\r\n   toggleDetails() {\r\n      const isOpen = this.$container.classList.toggle('details_open');\r\n      const symbol = this.$summary.querySelector('.symbol');\r\n\r\n      if (isOpen) {\r\n         symbol.classList.remove('plus');\r\n         symbol.classList.add('minus');\r\n\r\n         // Obtener la altura total del contenedor\r\n         const fullHeight = this.$container.scrollHeight + 'px';\r\n\r\n         // Establecer la altura para iniciar la animaci√≥n\r\n         this.$container.style.height = fullHeight;\r\n\r\n         // Despu√©s de la transici√≥n, ajustar la altura a 'auto'\r\n         this.$container.addEventListener('transitionend', function onTransitionEnd() {\r\n            this.style.height = 'auto';\r\n            this.removeEventListener('transitionend', onTransitionEnd);\r\n         });\r\n      } else {\r\n         symbol.classList.remove('minus');\r\n         symbol.classList.add('plus');\r\n\r\n         // Establecer la altura para iniciar la animaci√≥n de cierre\r\n         this.$container.style.height = this.$container.scrollHeight + 'px';\r\n\r\n         // Forzar el reflujo para que la transici√≥n funcione\r\n         requestAnimationFrame(() => {\r\n            this.$container.style.height = '0';\r\n         });\r\n      }\r\n   }\r\n\r\n   get title() {\r\n      return this._title;\r\n   }\r\n\r\n   set title(value) {\r\n      this._title = value;\r\n      // ‚úÖ Validar que value no sea null o undefined\r\n      if (value !== null && value !== undefined && this.$detailsTitle) {\r\n         this.$detailsTitle.textContent = value;\r\n      }\r\n   }\r\n\r\n   get text() {\r\n      return this._text;\r\n   }\r\n\r\n   set text(value) {\r\n      this._text = value;\r\n      // ‚úÖ Validar que value no sea null o undefined\r\n      if (value !== null && value !== undefined && this.$detailsText) {\r\n         this.$detailsText.textContent = value;\r\n      }\r\n   }\r\n\r\n   addDetail(value) {\r\n      // ‚úÖ Validar que value sea un nodo v√°lido\r\n      if (!value || !(value instanceof Node)) {\r\n         console.warn('Details.addDetail: value must be a valid DOM Node');\r\n         return;\r\n      }\r\n      \r\n      if (this.$details) {\r\n         this.$details.appendChild(value);\r\n      }\r\n   }\r\n}\r\n\r\nwindow.Details = Details;\ncustomElements.define('slice-details', Details);\nreturn Details;",
    "externalDependencies": {},
    "componentDependencies": [],
    "html": "<div class=\"details_summary\">\r\n   <div class=\"symbol plus\"></div>\r\n   <span class=\"details_title\"></span>\r\n</div>\r\n<div class=\"details_container\">\r\n   <div class=\"full_details\">\r\n      <div class=\"details_text\"></div>\r\n   </div>\r\n</div>\r\n",
    "css": "slice-details {\r\n   font-family: var(--font-family);\r\n   color: var(--font-primary-color);\r\n}\r\n.details_summary {\r\n   cursor: pointer;\r\n   display: flex;\r\n   align-items: center;\r\n   border-bottom: var(--slice-border) solid var(--primary-color);\r\n   padding: 10px;\r\n}\r\n.details_summary .caret {\r\n   transform: rotate(-90deg);\r\n   margin-right: 10px;\r\n   color: var(--primary-color);\r\n}\r\n.details_title {\r\n   width: 100%;\r\n   font-weight: bold;\r\n}\r\n.details_text {\r\n   color: var(--font-secondary-color);\r\n}\r\n.details_container {\r\n   padding-left: 5px;\r\n   padding: 10px;\r\n   background-color: var(--secondary-background-color);\r\n   border-radius: var(--border-radius-slice);\r\n   visibility: hidden;\r\n   display: block;\r\n   height: 0; /* Inicia con altura 0 */\r\n   overflow: hidden;\r\n   transition:\r\n      height 0.3s ease,\r\n      visibility 0.3s ease; /* Agrega transici√≥n a height */\r\n}\r\n\r\n.details_open {\r\n   height: auto; /* Altura se ajustar√° autom√°ticamente despu√©s de la transici√≥n */\r\n   visibility: visible;\r\n}\r\n\r\n.symbol {\r\n   border-radius: 5px;\r\n   width: 20px;\r\n   height: 20px;\r\n   position: relative;\r\n   transition: transform 0.3s ease;\r\n}\r\n\r\n.symbol::before,\r\n.symbol::after {\r\n   content: '';\r\n   position: absolute;\r\n   background-color: var(--primary-color);\r\n   width: 15px;\r\n   height: 2px;\r\n   top: 50%;\r\n   left: 0;\r\n   transition: transform 0.5s ease;\r\n}\r\n\r\n.symbol.plus::after {\r\n   transform: rotate(90deg);\r\n}\r\n\r\n.symbol.minus::before,\r\n.symbol.minus::after {\r\n   transform: rotate(360deg);\r\n}\r\n",
