    "js": "class Grid extends HTMLElement {\r\n\r\n   static props = {\r\n      columns: { \r\n         type: 'number', \r\n         default: 1, \r\n         required: false \r\n      },\r\n      rows: { \r\n         type: 'number', \r\n         default: 1, \r\n         required: false \r\n      },\r\n      items: { \r\n         type: 'array', \r\n         default: [], \r\n         required: false \r\n      },\r\n      gap: {\r\n         type: 'string',\r\n         default: '10px',\r\n         required: false\r\n      },\r\n      columnTemplate: {\r\n         type: 'string',\r\n         default: null,\r\n         required: false\r\n      },\r\n      rowTemplate: {\r\n         type: 'string',\r\n         default: null,\r\n         required: false\r\n      }\r\n   };\r\n\r\n   constructor(props) {\r\n      super();\r\n      slice.attachTemplate(this);\r\n\r\n      this.$grid = this.querySelector('.grid-container');\r\n\r\n      slice.controller.setComponentProps(this, props);\r\n   }\r\n\r\n   async init() {\r\n      // Static props ensure columns and rows have default values\r\n      // Apply gap if provided\r\n      if (this.gap) {\r\n         this.$grid.style.gap = this.gap;\r\n      }\r\n   }\r\n\r\n   set columns(value) {\r\n      this._columns = value;\r\n      // Si hay un template personalizado, usarlo; sino usar repeat\r\n      if (!this.columnTemplate) {\r\n         this.$grid.style.gridTemplateColumns = `repeat(${value}, 1fr)`;\r\n      }\r\n   }\r\n\r\n   get columns() {\r\n      return this._columns;\r\n   }\r\n\r\n   set rows(value) {\r\n      this._rows = value;\r\n      // Si hay un template personalizado, usarlo; sino usar repeat\r\n      if (!this.rowTemplate) {\r\n         this.$grid.style.gridTemplateRows = `repeat(${value}, 1fr)`;\r\n      }\r\n   }\r\n\r\n   get rows() {\r\n      return this._rows;\r\n   }\r\n\r\n   set gap(value) {\r\n      this._gap = value;\r\n      if (this.$grid) {\r\n         this.$grid.style.gap = value;\r\n      }\r\n   }\r\n\r\n   get gap() {\r\n      return this._gap;\r\n   }\r\n\r\n   set columnTemplate(value) {\r\n      this._columnTemplate = value;\r\n      if (value && this.$grid) {\r\n         this.$grid.style.gridTemplateColumns = value;\r\n      }\r\n   }\r\n\r\n   get columnTemplate() {\r\n      return this._columnTemplate;\r\n   }\r\n\r\n   set rowTemplate(value) {\r\n      this._rowTemplate = value;\r\n      if (value && this.$grid) {\r\n         this.$grid.style.gridTemplateRows = value;\r\n      }\r\n   }\r\n\r\n   get rowTemplate() {\r\n      return this._rowTemplate;\r\n   }\r\n\r\n   set items(values) {\r\n      this.setItems(values);\r\n      this._items = values;\r\n   }\r\n\r\n   get items() {\r\n      return this._items;\r\n   }\r\n\r\n   async setItem(item) {\r\n      if (!item || !item.classList) {\r\n         console.warn('Grid: Invalid item provided to setItem', item);\r\n         return;\r\n      }\r\n      item.classList.add('grid-item');\r\n      this.$grid.appendChild(item);\r\n   }\r\n\r\n   async setItems(items) {\r\n      if (!items || !Array.isArray(items)) {\r\n         console.warn('Grid: Invalid items array provided', items);\r\n         return;\r\n      }\r\n      for (let i = 0; i < items.length; i++) {\r\n         await this.setItem(items[i]);\r\n      }\r\n   }\r\n\r\n   // M√©todo para limpiar el grid\r\n   clear() {\r\n      if (this.$grid) {\r\n         this.$grid.innerHTML = '';\r\n      }\r\n   }\r\n}\r\n\r\nwindow.Grid = Grid;\ncustomElements.define('slice-grid', Grid);\nreturn Grid;",
